import React from 'react';
import "./write.css";

const Write = () => {
    return ( 
    <div className='write'>
        <form className='writeForm'>
            <div className="writeFormGroup">
                <input type="file" id="fileInput" />
                <input type="text" placeholder="Title" />
            </div>
        </form>
    </div> 
    );
}
 
export default Write;
